import React from 'react';
import ReactDOM from 'react-dom';
import './index.css';
import App from './App';


let postsData = [
    {id: 1, message: 'Hi, my friend!', likesCount: 11},
    {id: 2, message: 'My first post', likesCount: 12},
];

ReactDOM.render(
    <App posts={postsData} />,
  document.getElementById('root')
);
